import React, { useState } from "react";
import "./Projetos.css";
import { Box, TextField } from '@mui/material';
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from 'react-router-dom';
import Snackbar from '@mui/material/Snackbar';
import Alert from '@mui/material/Alert';
import Autocomplete from '@mui/lab/Autocomplete';
import Chip from '@mui/material/Chip';

const Projetos = () => {
    const navigate = useNavigate();
  
    const [state, setState] = useState({
        titulo: '',
        descricao: '',
        prazo: '',
        nome: '',
    });

    const [tags, setTags] = useState([]);

    const [snackbarOpen, setSnackbarOpen] = useState(false);
    const [snackbarMessage, setSnackbarMessage] = useState('');
    const [snackbarSeverity, setSnackbarSeverity] = useState('success'); // Pode ser 'success' ou 'error'

    const handleChange = (campo) => (event) => {
      setState({ ...state, [campo]: event.target.value });
    }
          
    const salvar = async () => {
        // Lógica para salvar
    }
   
    const cancel = () => {
        console.log('cancel');
    }

    const goToAssociado = () => {
        navigate("/sessao/createAssociado");
    }

    const goToCliente = () => {
        navigate("/sessao/createCliente");
    }

    const handleCloseSnackbar = () => {
        setSnackbarOpen(false);
    };

    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-12">
                    <div className="bs-component">
                        <div style={{marginTop: '80px'}}>
                                <ButtonGroup style={{height:'30px'}} variant="contained" aria-label="Basic button group">
                                <Button style={{ backgroundColor: 'grey', fontSize: 10, width: 120 }} onClick={goToCliente}>Processos</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, width: 120 }}>Status</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, alignItems: 'center', width: 120  }} onClick={goToAssociado}>Anexos</Button>
                                </ButtonGroup>
                                <div style={{width: 1100, height: 470, background: 'white', border: '2px #838383 solid'}}>
                                    
                                    <div style={{marginTop: '25px', marginLeft: '30px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>TITULO</div>
                                    <TextField
                                    hiddenLabel
                                    id="filled-hidden-label-small"
                                    defaultValue=""
                                    variant="filled"
                                    size="small"
                                    sx={{
                                        marginTop: '-15px',
                                        width: '250px',
                                        '& .MuiInputBase-root': {
                                          height: '32px',
                                          padding: '0 14px',
                                          '& input': {
                                            height: '20px',
                                            padding: '0',
                                            fontSize: '13px',
                                          },
                                        },
                                      }}
                                    value={state.titulo}
                                    onChange={handleChange('titulo')} 
                                    />
                                    </div>

                                    <div style={{marginTop: '25px', marginLeft: '30px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>DESCRIÇÃO</div>
                                    <TextField
                                    hiddenLabel
                                    id="filled-hidden-label-small"
                                    defaultValue=""
                                    variant="filled"
                                    size="small"
                                    multiline
                                    rows={4}
                                    sx={{
                                    marginTop: '-15px',
                                    width: '250px',
                                    '& .MuiInputBase-root': {
                                    height: 'auto',
                                    padding: '0 14px',
                                    '& textarea': {
                                    height: '20px',
                                    fontSize: '13px',
                                    textAlign: "left",
                                    },
                                        },
                                            }}
                                    value={state.descricao}
                                    onChange={handleChange('descricao')} 
                                    />
                                    </div>
                                    <div style={{marginTop: '25px', marginLeft: '70px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>PRAZO</div>
                                    <TextField
                                    hiddenLabel
                                    id="filled-hidden-label-small"
                                    defaultValue=""
                                    variant="filled"
                                    size="small"
                                    type="date"
                                    sx={{
                                        marginTop: '-15px',
                                        width: '130px',
                                        '& .MuiInputBase-root': {
                                          height: '32px',
                                          padding: '0 14px',
                                          '& input': {
                                            height: '20px',
                                            padding: '0',
                                            fontSize: '13px',
                                          },
                                        },
                                      }}
                                    value={state.prazo}
                                    onChange={handleChange('prazo')} 
                                    />
                                    </div>

                                    <div style={{marginTop: '-295px', marginLeft: '700px'}}>
                                    <div style={{width: 200, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>REGISTRO DA RECEITA FEDERAL</div>
                                    <TextField
                                    hiddenLabel
                                    id="filled-hidden-label-small"
                                    defaultValue=""
                                    variant="filled"
                                    size="small"
                                    sx={{
                                        marginTop: '-15px',
                                        width: '250px',
                                        '& .MuiInputBase-root': {
                                          height: '32px',
                                          padding: '0 14px',
                                          '& input': {
                                            height: '20px',
                                            padding: '0',
                                            fontSize: '13px',
                                          },
                                        },
                                      }}
                                    value={state.nome}
                                    onChange={handleChange('nome')} 
                                    />
                                    <div style={{marginTop: '25px'}}>
                                    <div style={{width: 200, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>TAGS</div>
                                    <Autocomplete
                                        multiple
                                        freeSolo
                                        options={[]}
                                        value={tags}
                                        onChange={(event, newValue) => setTags(newValue)}
                                        renderTags={(value, getTagProps) =>
                                        value.map((option, index) => (
                                            <Chip variant="outlined" label={option} {...getTagProps({ index })} />
                                        ))
                                        }
                                        renderInput={(params) => (
                                        <TextField
                                            {...params}
                                            variant="filled"
                                            hiddenLabel
                                            size="small"
                                            sx={{
                                            marginTop: '-15px',
                                            width: '250px',
                                            '& .MuiInputBase-root': {
                                                height: '320px',
                                                padding: '0 14px',
                                                '& input': {
                                                height: '20px',
                                                padding: '0',
                                                fontSize: '13px',
                                                },
                                            },
                                            }}
                                        />
                                        )}
                                    />
                                    <div style={{marginTop: '15px', display: 'flex', flexWrap: 'wrap', gap: '5px'}}>
                                        {tags.map((tag, index) => (
                                            <Chip
                                                key={index}
                                                label={tag}
                                                onDelete={() => {
                                                    const newTags = [...tags];
                                                    newTags.splice(index, 1);
                                                    setTags(newTags);
                                                }}
                                                variant="outlined"
                                            />
                                        ))}
                                    </div>
                                    </div>
                                    </div>

                                    </div>
                                <div style={{ marginTop: '-140px' }}>
                                    <Button onClick={salvar} variant="contained" style={{width: 120, height: 40, backgroundColor: 'grey'}}>Salvar</Button>
                                    <Button onClick={cancel} variant="contained" style={{width: 120, height: 40, backgroundColor: 'grey', marginLeft: '850px'}}>Cancelar</Button>
                                </div>
                        </div>
                    </div>
                </div>
            </div>
            <Snackbar open={snackbarOpen} autoHideDuration={6000} onClose={handleCloseSnackbar}>
            <Alert onClose={handleCloseSnackbar} severity={snackbarSeverity} sx={{ width: '100%' }}>
                {snackbarMessage}
            </Alert>
            </Snackbar>
        </div>
    );
}

export default Projetos;
